import {LOGIN_REQUEST} from '../actions/authactions'

const inisialState ={
    user:[]
}

 const authReducer = (state =inisialState,action)=>{
 switch (action.type){
     case LOGIN_REQUEST:
         state={
             ...state,
             ...action.payload
         }
         break
         default:
             state
 }
 return state
};
export default authReducer
